class d{constructor(){this.init()}init(){let t=document.head.querySelector('meta[name="x-cms-edit-link"]');if(t){let a=document.head.querySelector('meta[name="x-cms-logout-link"]');document.getElementsByTagName("body")[0];let e=document.createElement("div");e.classList.add("adminctrl"),e.innerHTML='          <ul>            <li data-i="exit"><a href="'+a.content+'" title="Log out"></a></li>            <li data-i="planet"><a href="/admin" title="Admin panel"></a></li>            <li data-i="build"><a href="'+t.content+'" title="Edit this page"></a></li>          </ul>      ',e.addEventListener("mouseover",n=>{document.getElementsByClassName("adminctrl")[0].classList.add("adminctrl--active")}),e.addEventListener("mouseout",n=>{document.getElementsByClassName("adminctrl")[0].classList.remove("adminctrl--active")}),setTimeout(()=>e.classList.add("adminctrl--visible"),100)}}}window.addEventListener("load",i=>{new d});
